class PersonModel{    
    constructor() {
      this.transactId=0;
      this.personType=""; //tipo de Persona
      this.idType=""; //tipo de Identificacion
      this.clientDocumentId="";//No. de identificacion
      this.customerNumberT24=""; //No. de Cliente T24
      this.name="";//1er Nombre
      this.secondName="";//2do Nombre
      this.lastName=""; //1er Apellido
      this.secondSurname=""//2do Apellido
      this.nationality="";//Nacionalidad
      this.birthDate="";//Fecha nacimiento "1998-08-17",
      this.address=""; //direccion
      this.phone=""; //Telefono,
      this.email="";//Email
      this.countryOfResidence="";//pais de residencia
    }
  }

  export default new PersonModel();
